import React from 'react';
import { BrowserRouter as Router, Routes, Route, useParams } from 'react-router-dom';
import ChatWidget from './components/ChatWidget';

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Define a route for your ChatWidget component */}
        <Route path="/chat/:prop1/:prop2" element={<ChatWidgetWrapper />} />
      </Routes>
    </Router>
  );
}

// Wrapper component to extract URL parameters and pass them to ChatWidget
const ChatWidgetWrapper = () => {
  const { prop1, prop2 } = useParams();
  console.log("props1:", prop1);
  console.log("props2:", prop2);

  return <ChatWidget prop1={prop1} prop2={prop2} />;
};

export default App;
